import React from "react";

function Match() {
  const basicInfo = [
    "Team Number",
    "Drive Train",
    "Auto Points",
    "Teleop Points",
    "Climb Level",
  ];
  const advancedInfo = ["Drive Motors", "Scoring Consistency"];
  return (
    <div>
      <div className="container">
        <small style={{ fontSize: "13px" }}>Basic Info</small>
        {basicInfo.map((val, key) => {
          return (
            <>
              <div className="row">
                <div className="col-4" style={{ fontSize: "15px" }}>
                  {val}
                </div>
                <div className="col-4">
                  <div className="input-group">
                    <input
                      type="text"
                      className="input-control align-middle"
                      style={{ height: "30px", marginTop: "-5px" }}
                    />
                  </div>
                </div>
              </div>
              <br />
            </>
          );
        })}
      </div>
    </div>
  );
}

export default Match;
